import React, { useState, useEffect } from 'react';
import axios from 'axios';
import './App.css';

const DataFrame = () => {
  const [context, setContext] = useState(null);
  const [posts, setPosts] = useState([]);
  const [loading, setLoading] = useState(true);
  const [error, setError] = useState(null);

  useEffect(() => {
    // Handling Two API endpoints
    const fetchContext = axios.get('http://127.0.0.1:8000/api/my_context/');
    const fetchPosts = axios.get('http://127.0.0.1:8000/api/posts/');

    Promise.all([fetchContext, fetchPosts])
      .then(([contextResponse, postsResponse]) => {
        setContext(contextResponse.data.my_info);
        setPosts(postsResponse.data);
        setLoading(false);
      })
      .catch(error => {
        setError(error);
        setLoading(false);
      });
  }, []);

  const handleDelete = (id) => {
    axios.delete(`http://127.0.0.1:8000/delete/${id}/`)
      .then(response => {
        setPosts(posts.filter(post => post.id !== id));
      })
      .catch(error => {
        console.error('Error deleting post:', error);
      });
  };
  

  if (loading) return <div>Loading...</div>;
  if (error) return <div>Error: {error.message}</div>;

  return (
    <div>
      <h1>Contact Page</h1>
      {context && <p className="title">{context.my_title}</p>}
      {Array.isArray(posts) && (
        <table className="dataframe">
          <thead>
            <tr>
              <th>Title</th>
              <th>Beds</th>
              <th>Floor</th>
              <th>Image</th>
              <th>Furnishing</th>
              <th>Super Areas</th>
              <th>Area Sqft</th>
              <th>Delete</th>
            </tr>
          </thead>
          <tbody>
            {posts.map(post => (
              <tr key={post.id}>
                <td>{post.name}</td>
                <td>{post.beds}</td>
                <td>{post.floor}</td>
                <td>
                  <img src={post.Image_url} alt={post.name} className="image" />
                </td>
                <td>{post.furnishing}</td>
                <td>{post.super_areas}</td>
                <td>{post.area_sqft}</td>
                <td>
                  <button type='button' onClick={() => handleDelete(post.id)}>Delete</button>
                </td>
              </tr>
            ))}
          </tbody>
        </table>
      )}
      {context && context.my_number && (
        <ul>
          {context.my_number.map((num, index) => (
            <li key={index}>{num}</li>
          ))}
        </ul>
      )}
    </div>
  );
};

export default DataFrame;
